import { Route, Routes } from 'react-router-dom';
import './App.css';

import NavBar from './components/navBar/navBar';
function App() {
  return (
    <div className="App">
      <NavBar/>
      <Routes>
          <Route path='/' element = ''/>
      </Routes>
    </div>
  );
}

export default App;
